Gallagher are the global leaders in electric fencing. The Gallagher Electric Fence Manual covers everything from wire and post spacing to what size energizer to use for different animals and fencing situations. It also covers the information on <em><strong>how to set up an electric fence with Gallagher power fencing products</strong></em>

